    public async Task Run()
    {
        using var httpClient = new System.Net.Http.HttpClient();

        var tasks = new List<Task<System.Net.Http.HttpResponseMessage>>();

        var stopwatch = Stopwatch.StartNew();

        foreach (var url in _urls)
        {
            tasks.Add(httpClient.GetAsync(url));
        }
        
        Console.WriteLine($"Running {tasks.Count} tasks in parallel");
        await Task.WhenAll(tasks);
        stopwatch.Stop();

        Console.WriteLine($"Completed Running all files in {stopwatch.Elapsed} milliseconds:");

        stopwatch = Stopwatch.StartNew();
        tasks.Clear();

        foreach (var url in _urls)
        {
            tasks.Add(httpClient.GetAsync(url));
        }

        Console.WriteLine($"Running {tasks.Count} tasks in parallel");
        await Task.WhenAll(tasks);
        stopwatch.Stop();
        Console.WriteLine($"Completed Running all files in {stopwatch.Elapsed} milliseconds with caching");
        Console.ReadLine();
    }
